import React from 'react';
import styled from 'styled-components';

const Timeline = () => {
  const projects = [
    { year: 2022, title: 'VR Project 1', description: 'Description of VR project 1...' },
    { year: 2023, title: 'VR Project 2', description: 'Description of VR project 2...' },
    { year: 2023, title: 'Fintech Project', description: 'Description of Fintech project...' },
  ];

  return (
    <TimelineSection id="projects">
      {projects.map((project, index) => (
        <TimelineItem key={index}>
          <Year>{project.year}</Year>
          <Content>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
          </Content>
        </TimelineItem>
      ))}
    </TimelineSection>
  );
};

const TimelineSection = styled.section`
  padding: 4rem 2rem;
  background: #f4f4f4;
`;

const TimelineItem = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 2rem;
`;

const Year = styled.div`
  font-size: 2rem;
  font-weight: bold;
  margin-right: 2rem;
`;

const Content = styled.div`
  background: #fff;
  padding: 1rem;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

export default Timeline;
